import React, { useState } from "react";
import img5 from '../image/img6.jpg';
import {NavLink} from 'react-router-dom';
import {FaUserAlt,FaEnvelope,FaPhoneAlt} from "react-icons/fa";
import { MdOutlineWork} from "react-icons/md";
import { RiLockPasswordFill} from "react-icons/ri";

   const Signup = () => {
  //const History = useHistory();
  const [get, setGEt] = useState({
    name:"" ,
    email:"",
    phone:"",
    work:"",
    password:"",
    cpassword:""
  })
  let name, value;
  const handleInputs = (e) =>{
   name = e.target.name;
   value = e.target.value;

   setGEt({...get,[name]:value});
  }
/*
  const PostData = async (e ) =>{s
  const { name,
  email,
  phone,
  work,
  password,
  cpassword } = get;

  const res = await fetch("/signup",{
    method: "POST",
    headers: {
      "Content-Type" : "application/json"
    },
    body:JSON.stringify(
  {name:name,email:email, phone:phone,work:work,password:password,cpassword:cpassword})
  });

  const data = await res.json();
  if(res.status === 422 || !data){
    window.alert("invalid");
    console.log("invalid");
  }else{
    window.alert("success");
    console.log("successful");
    History.push("/login");
  }
}*/

    return (
      <>
           <div className="container-fluid">
          <div className="container cont1">
               <div className="Signup-cont  col-lg-10 mx-auto">
                   <div className="row">
                         <div className="col-md-6">
                            <div className="LeftCon">
                               <form className="SignupForm  text-center">
                                 <h1>SignUp</h1>
                                 <div className="text-group">
                                 <FaUserAlt/>
                                 <input  type="text" className="text-Box" name="name" placeholder="Your Name" id="name" 
                                 required={true}/>
                                 </div>

                                 <div className="text-group">
                                 <FaEnvelope/>
                                 <input  type="email" className="text-Box" name="email" placeholder="Your Email" id="email" 
                                 required={true}/>
                                 </div>

                                 <div className="text-group">
                                 <FaPhoneAlt/>
                                 <input  type="number" className="text-Box" name="Phone" placeholder="Phone no" id="Phone" 
                                 required={true}/>
                                 </div>
                                 <div className="text-group">
                                 <MdOutlineWork/>
                                 <input  type="text" className="text-Box" name="work" placeholder="Your Profession" id="work" 
                                 required={true}/>
                                 </div>

                                 <div className="text-group">
                                 <RiLockPasswordFill/>
                                 <input  type="password" className="text-Box" name="password" placeholder="Your Password" id="password" 
                                required={true}/>
                                 </div>

                                 <div className="text-group">
                                 <RiLockPasswordFill/>
                                 <input  type="password" className="text-Box" name="cpassword" placeholder="Your Confirm Password" id="cpassword" 
                                required={true}/>
                                 </div>
                                 

                                 <input type="submit" name="Submit" id="Submit" value="Register" className="stylebtn" />
                                 </form> 
                            </div>
                         </div>

                         <div className="col-md-6">
                               <div className="RightCon">
                                 <img src={img5}  className="img-fluid img-thumbnail"alt='signuppic'/>
                               </div>
                               <p> <NavLink to="/login">Already Register </NavLink></p>

                         </div>
                   </div>
               </div>
          </div>
            </div>

     
      </>

    );
    }
  
  export default Signup;
